item.itunes:summary:
Pour cet emission du mois de février j'ai le plaisir d'inviter Floodygo. Puisant son inspiration dans l’énergie brute de la raves 90 et ailleurs, Floodygo façonne des sets où se mêlent profondeur, rythmes breakés et envolées aériennes. Installée dans le sud-ouest de la France, elle nourrit son univers musical à travers une quête perpétuelle de nouveautés, explorant les scènes émergentes et dénichant des pépites sonores aux quatre coins de l’Europe. Son approche instinctive du mix lui permet de tisser des atmosphères aussi hypnotiques que percutantes, où les basses enveloppent, les kicks kickent avec précision. Refusant toute frontière, Floodygo sculpte des voyages sonores où se croisent influences UK, euro trancy vibes, synthés 80's, textures deep et échos rave, créant ainsi une expérience de tous les sens.
3 artists : Sevenbeatz Romain FX Rohit Ooman
@floodygo @thomasgaride https://www.diaradio.live

